  color: rgb(255, 0, 0);
}
.todo__scroll {
  overflow: auto;
  max-height: 60%;
  width: 70%;
  margin: 0 10px 0 18%;
}
.todo__scroll ul {
  margin: 0;
  padding: 0;
  list-style: none;
}
.todo__scroll ul li {
  cursor: pointer;
  position: relative;
  padding: 12px 8px 12px 40px;
  background: rgb(243, 240, 240);
  font-size: 18px;
  transition: 0.2s;
  user-select: none;
}
.todo__scroll ul li:nth-child(odd) {
  background: rgb(212, 211, 211);
}
.todo__scroll ul li:hover {
  background: rgb(151, 151, 147);
}
.todo__scroll ul li.checked {
  background: rgb(235, 163, 163);
  color: rgb(97, 10, 10);
  text-decoration: line-through;
}
.todo__scroll ul li.checked::before {
  content: '';
  position: absolute;
  border-color: rgb(32, 7, 7);
  border-style: solid;
  border-width: 0 2px 2px 0;
  top: 10px;
  left: 16px;
  transform: rotate(45deg);
  height: 15px;
  width: 7px;
}
.icon__delit {
  width: 40px;
  height: 25px;
  background-color: rgb(250, 252, 172);
  position: absolute;
  right: 20px;
  top: center;
}
.icon__delit::after {
  content: '';
  position: absolute;
  top: 0;
  left: 10px;
  background-image: url(./img/delete.png);
  background-size: 20px 20px;
  background-repeat: no-repeat;
  width: 40px;
  height: 20px;
}
.pen {
  width: 70px;
  background-image: url(./img/pen.png);
  background-size: 100% 500px;
  background-repeat: no-repeat;
  margin-top: 100px;
}
footer {
  background-color: rgb(253, 216, 5);
  width: 100%;
  padding-top: 1%;
  color: rgb(253, 216, 5);
}
.footer__content {
  display: flex;
  justify-content: space-evenly;
  width: 95%;
  height: 80px;
  margin: 10px auto;
  background-color: rgb(0, 0, 0);
  border-radius: 25px;
  padding: 0 10%;
}
footer h5 {
  padding-top: 1%;
}
footer a {
  margin-top: 20px;
}
.socialIcon {
  fill: rgb(255, 255, 255);
  transition: all .3s;
}
.socialIcon:hover {
  fill: rgb(220, 243, 11);
  transform: scale(1.1);
}
@media screen and (max-width: 1200px) {
  aside {
    padding-top: 70px;
    max-height: 450px;
    min-height: 100px;
    min-width: 200px;
  }
  .fon_time h2,
  .month h2 {
    font-size: 20px;
    margin-top: 10px;
  }
  .fon_time h3 {
    font-size: 12px;
    line-height: 12px;
    margin-bottom: 10px;
  }
  .container {
    margin-top: 15px;
  }
  .container h2 {
    font-size: 16px;
    text-align: center;
    margin-top: 0;
  }
  table {
    font-size: 12px;
  }
}

@media screen and (max-width: 1000px) {
  .pen {
    display: none;
  }
}

@media screen and (max-width: 900px) {

  li>h2 {
    font-size: 20px;
    text-align: center;
  }
  h2+h4 {
    font-size: 14px;
    text-align: right;
  }
  .addBtn {
    font-size: 10px;
    height: 42px;
    padding: 2px;
  }
}

